import React from 'react'
import PropTypes from 'prop-types'

// redux

const NoteItem = ({ note, bookId }) => {
    return (
        <div>
            {note.text}
            {note.type}
        </div>
    )
}

NoteItem.propTypes = {
    note: PropTypes.object.isRequired,
    bookId: PropTypes.number.isRequired,
}

export default NoteItem
